import React from "react";
import { connect } from "react-redux";
import { currentUser } from "../actions/auth";
const {TeamTrees} = require('teamtrees-api');

class Dashboard extends React.Component {

  render() {
    let x = new TeamTrees({
      rateLimit: true, // enable rate limiter
      cache: {
        enable: true, // enable the cache syste,
        duration: 5 // time to hold the data in minutes
      }
    })
    x.getTotalTrees(true).then(console.log);
    return <div>
      <h2 style={{color: '#FFFFFF'}}>Ability to donate to #TeamTrees API is coming very soon!</h2>
    </div>
  }
}

const mapStateToProps = (state) => {
  return {
    auth: state.auth,
    current_user: state.currentUser,
  };
};

const mapDispatchToProps = {
  currentUser,
};

export default connect(mapStateToProps, mapDispatchToProps)(Dashboard);
